import { useEffect, useState } from "react";
import Header from "./Header";
import Login from "./Login";

const App = () => {
  const [loginAcccunt, setLoginAccount] = useState();

  useEffect(() => {
    setLoginAccount(sessionStorage.getItem("login"));
  }, [loginAcccunt]);

  return <div className="dark">{!loginAcccunt ? <Login /> : <Header />}</div>;
};

export default App;
